import React, { Component } from "react";

class Tab extends Component {
  render() {
    const items = this.props.items;
    return (
      <React.Fragment>
        <ul>
          {items.map((item) => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
        
        <section>test</section>
      </React.Fragment>
    );
  }
}

export default Tab;
